  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0112362 includes chemical,
  discrete sample, physical and profile data collected from Kaiyo in the North Pacific
  Ocean and South Pacific Ocean from 1994-01-06 to 1994-02-05 and retrieved during
  cruise K93-07 and PACIFICA_49XK19940106. These data include DISSOLVED INORGANIC
  CARBON, DISSOLVED OXYGEN, HYDROSTATIC PRESSURE, NITRATE, NITRITE, PHOSPHATE, Potential
  temperature (theta), SALINITY, SILICATE and WATER TEMPERATURE. The instruments used
  to collect these data include CTD, Coulometer for DIC measurement and bottle. These
  data were collected by Ichio Asanuma of Japan Agency for Marine-Earth Science and
  Technology (Jamstec) and Masao Ishii of Meteorological Research Institute; Geochemical
  Research Department as part of the PACIFICA_49XK19940106 data set.nnPACIFICA (PACIFic
  ocean Interior CArbon) was an international collaborative project for the data synthesis
  of ocean interior carbon and its related parameters in the Pacific Ocean. The North
  Pacific Marine Science Organization (PICES), Section of Carbon and Climate (S-CC)
  supported the project.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
